import React, { useEffect, useState } from 'react'
import Axios from 'axios'
const App = ()=> {
  const [data,setdata] = useState("");

  const getdata = async()=>{
    const response = await Axios.get("http://localhost:/getdata")
    setdata(response.data);
  }
  useEffect(()=>{
    getdata()
  },[]);  
  return (
    <div>{data}</div>
  )
}

export default App
